-- Apache Ignite 3 SQL Usage Demo
-- This file demonstrates inserting data into Apache Ignite 3 tables

DROP TABLE IF EXISTS country_language;
DROP TABLE IF EXISTS city;
DROP TABLE IF EXISTS country;
DROP ZONE IF EXISTS storage_zone;

CREATE ZONE IF NOT EXISTS storage_zone (PARTITIONS 50, REPLICAS 3) STORAGE PROFILES ['default'];

CREATE TABLE country (
  code VARCHAR PRIMARY KEY,
  name VARCHAR,
  continent VARCHAR,
  region VARCHAR,
  surface_area DECIMAL(10,2),
  indep_year SMALLINT,
  population INT,
  life_expectancy DECIMAL(3,1),
  gnp DECIMAL(10,2),
  gnp_old DECIMAL(10,2),
  local_name VARCHAR,
  government_form VARCHAR,
  head_of_state VARCHAR,
  capital INT,
  code2 VARCHAR
) ZONE storage_zone STORAGE PROFILE 'default';

CREATE TABLE city (
  id INT,
  name VARCHAR,
  country_code VARCHAR,
  district VARCHAR,
  population INT,
  PRIMARY KEY (id, country_code)
) ZONE storage_zone STORAGE PROFILE 'default';

CREATE INDEX idx_country_code ON city (country_code);

CREATE TABLE country_language (
  country_code VARCHAR,
  language VARCHAR,
  is_official VARCHAR,
  percentage DECIMAL(4,1),
  PRIMARY KEY (country_code, language)
) ZONE storage_zone STORAGE PROFILE 'default';

CREATE INDEX idx_lang_country_code ON country_language (country_code);





